import logo from './logo.svg';
import './App.css';
import Navbar from './frontend/components/Navbar';

function App() {
  return (
    <div className="App">
      <div className="homeNav">
        <Navbar ></Navbar>
      </div>

      <div className="viewContainer">
        <div class="jumbo">
          <h2>Welcome to Leasly</h2>
          <h3>This is the home page for Leasly</h3>
        </div>
        <ul>

            <li></li>

        </ul>
          <form action="form">
            <button type="submit">Create a New Listing</button>
          </form>
          <button type="button">View All Apartments</button>
      </div>
    </div>
  );
}

export default App;
